      textAlign: 'center',
    }

  }));

interface OwnProps {
  persons: any[];
}

type Props = OwnProps;


function ShowContacts({ persons }: Props) {

  const classes = useStyles();

  return (
    <div>
      <Box className={classes.form}>
        <Typography variant="h5" color="primary">
          Your Contacts
        </Typography>
        <Persons/>
